import classes from "./Products.module.css";
import Button from "../UI/Button";
import shoes from "../images/shoes.jpeg";

const Products = (props) => {
  return (
    <div>
      <figure>
        <img src={shoes} alt="shoes" />
      </figure>
      <div>
        <div>Shoes</div>
        <div>$99</div>
      </div>
      <Button>Add to cart</Button>
    </div>
  );
};

export default Products;
